class Image
{
    const PHALCON = '';
    const LYNX = ')';
}

?>
<!doctype html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Info</title>
    <style type="text/css">
        .container {
            width: 960px;
            margin: 0 auto;
        }
        .row {
            width: 100%;
        }
        .ext-logo {
            width: 100px;
            height: 100px;
        }
    </style>
</head>
<body>
    <div class="container">
        PHP Version: <?php echo phpversion(); ?><br/>
        Hostname: <?php echo gethostname(); ?><br/>
