            </div>
        <?php endif; ?>

        <?php if (extension_loaded('Lynx')) : ?>
            <div class="row">
                <?php $ext = new ReflectionExtension('lynx'); ?>
                <?php echo '<img src="http://dmtry.me/img/logos/lynx_bnw.svg" class="ext-logo">'; ?>
                <?php echo "Lynx Version: " . $ext->getVersion() . "</br>"; ?>
            </div>
        <?php endif; ?>
    </div>
</body>
</html>